INSERT INTO `rainlab_translate_attributes` VALUES ('1', 'en', '1', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"How to book a room at Aura Co-living? How much is the room rate per month? Can I have a room tour before making decision? Can I share the room with friends?\",\"content\":\"The room rate is 3,5million per month including water and electricity supply fee, excludes parking fee.You will get a room tour before booking. Unfortunately, you can not share the room with friends because our rooms have been designed for 1 capacity to ultilize user’s privacy.\"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('2', 'en', '2', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"Do I have to place a deposit to book a room in Aura Co-living? What is your cancellation policy?\",\"content\":\"As for long term guest, you have to deposit at least 2-month room rent (7 million). As for short term, you don’t have to leave a deposit. \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('3', 'en', '3', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"What is your check-out policy?\",\"content\":\"As for long term guest, you must inform 1 month in advance if you want to check out. As for short term, you just have to check out before 2pm \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('4', 'en', '4', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"Do I have to place a deposit to book a room in Aura Co-living? What is your cancellation policy?\",\"content\":\"As for long term guest, you have to deposit at least 2-month room rent (7 million). As for short term, you don’t have to leave a deposit. \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('5', 'en', '5', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"What administrative papers do I need to move in Aura Co-living?\",\"content\":\"Regarding to short term guest, you just need to provide ID card\\/ passport to check in. If you are a long term guest, you need to provide ID card\\/passport plus the registration form of temporary absence according to Vietnam law. \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('6', 'en', '6', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"How is Aura Coliving different from other types of residence such as homestay, guest-house or a dorm?\",\"content\":\"The differences between Aura Co-living and other types of residence are Aura member can access to the convenient Aura co-working space. Also, there are many workshops, soft-skill classes, dance, yoga and fitness held everyday to help Aura members to improve knowledge and release stress. Besides, we have an Aura District app for members to update our incoming events, register to our workshops and scan QR code to make payment. \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('7', 'en', '7', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"\",\"content\":\"\"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('8', 'en', '8', 'Aura\\Backend\\Models\\Faq', '{\"title\":\"What is Aura Event Space included?\",\"content\":\"Aura Event Spaces have elegant design, central location. Aura provide you with all relevant equipment right on site, wether you need projectors, sreen, microphones or moderation kits. If you need document  for your event, let us connect you with our professional videographers and photographers to capture memorable moments during your event. You have also benefit from transparent pricing. You do not need a Aura membership to gain access to these attractive event spaces. Our dynamic, well – designed premises can be booked at any time for public as well as private events. All spaces are highly customizable to give you more opportunities to make the space your own. From the room layout to the coordinate of the speakers, and the provision of multimemedia equipment, our experienced on – site team are there to help. If you need spaces to organize event, Aura is great choice for you. \"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('9', 'en', '2', 'Aura\\Backend\\Models\\Menu', '{\"title\":\"\"}');
INSERT INTO `rainlab_translate_attributes` VALUES ('10', 'en', '3', 'Aura\\Backend\\Models\\Menu', '{\"title\":\"\"}');
